    for(let i = 0; i<arr.length; i++){
        arr1[i] = arr[i];
    }

    console.log(arr1);

    function updateArr1(){
        arr1.push(6);
        console.log(arr1);
        setArr1(arr1);
    };

    return (
        <div>
            {arr1}
            <button className = "btn" onClick = {updateArr1}>update arr1</button>
        </div>
    );
}

export default Tasks;
